def magic_square_test(matrix):
    n = len(matrix)
    s = set()
    for row in matrix:
        s.update(row)
    if s != set(range(1, n*n+1)):
        return False
    target = sum(matrix[0])
    for row in matrix:
        if sum(row) != target:
            return False
    for col in range(n):
        if sum(matrix[row][col] for row in range(n)) != target:
            return False
    if sum(matrix[i][i] for i in range(n)) != target:
        return False
    if sum(matrix[i][n-1-i] for i in range(n)) != target:
        return False
    return True

