def find_solution(a, b, n):
    def extended_gcd(x, y):
        if y == 0:
            return x, 1, 0
        g, s, t = extended_gcd(y, x % y)
        return g, t, s - (x // y) * t

    g, x, y = extended_gcd(a, b)
    if n % g != 0:
        return None
    x *= n // g
    y *= n // g
    return (x, y)

