def is_majority(arr, n, x):
    def first_occurrence(arr, x):
        low, high = 0, n - 1
        while low <= high:
            mid = (low + high) // 2
            if arr[mid] == x:
                if mid == 0 or arr[mid - 1] < x:
                    return mid
                high = mid - 1
            elif arr[mid] < x:
                low = mid + 1
            else:
                high = mid - 1
        return -1

    first = first_occurrence(arr, x)
    if first == -1:
        return False
    if first + n // 2 < n and arr[first + n // 2] == x:
        return True
    return False

