def lps(s):
    s = s.replace(" ", "")
    n = len(s)
    dp = [[0]*n for _ in range(n)]
    for i in range(n):
        dp[i][i] = 1
    for cl in range(2, n+1):
        for i in range(n-cl+1):
            j = i+cl-1
            if s[i] == s[j]:
                dp[i][j] = 2 + (dp[i+1][j-1] if cl > 2 else 0)
            else:
