def is_prime(n):
    if n < 2:
        return False
    if n in (2, 3):
        return True
    if n % 2 == 0 or n % 3 == 0:
        return False
    i = 5
    while i * i <= n:
        if n % i == 0 or n % (i + 2) == 0:
            return False
        i += 6
    return True

def newman_prime(n):
    NS = [1, 1, 2, 3]
    primes = []
    i = 4
    while len(primes) < n:
        val = 2 * NS[i - 1] + NS[i - 2]
        NS.append(val)
        if is_prime(val):
            primes.append(val)
        i += 1
    return primes[n - 1]

