def max_sub_array_sum_repeated(arr, n, k):
    def kadane(a):
        max_ending_here = max_so_far = a[0]
        for x in a[1:]:
            max_ending_here = max(x, max_ending_here + x)
            max_so_far = max(max_so_far, max_ending_here)
        return max_so_far

    max_kadane = kadane(arr)
    total_sum = sum(arr)

    if k == 1:
        return max_kadane

    max_prefix = max_suffix = curr = 0
    for i in range(n):
        curr += arr[i]
        max_prefix = max(max_prefix, curr)

    curr = 0
    for i in range(n - 1, -1, -1):
        curr += arr[i]
        max_suffix = max(max_suffix, curr)

    if total_sum > 0:
        return max(max_kadane, max_suffix + total_sum * (k - 2) + max_prefix)
    else:
        return max(max_kadane, max_suffix + max_prefix)

