def get_total_number_of_sequences(m, n):
    from functools import lru_cache

    @lru_cache(None)
    def dfs(prev, length):
        if length == n:
            return 1
        count = 0
        start = max(1, 2 * prev)
        for next_val in range(start, m + 1):
            count += dfs(next_val, length + 1)
        return count

    total = 0
    for first in range(1, m + 1):
        total += dfs(first, 1)
    return total

