def get_total_number_of_sequences(n, m):
    from functools import lru_cache

    @lru_cache(None)
    def dfs(pos, prev):
        if pos == n:
            return 1
        total = 0
        start = 1 if prev == 0 else prev * 2
        for x in range(start, m + 1):
            total += dfs(pos + 1, x)
        return total

    return dfs(0, 0)

