    for idx in range(i + 1):
        dp[idx] = arr[idx]
    for idx in range(i + 1):
        for j in range(idx):
            if arr[j] < arr[idx]:
                dp[idx] = max(dp[idx], dp[j] + arr[idx])
    max_sum = 0
    for idx in range(i + 1):
        if arr[idx] < arr[k]:
            max_sum = max(max_sum, dp[idx])
    return max_sum + arr[k]

