def get_max_sum(n):
    memo = {}
    def f(x):
        if x == 0:
            return 0
        if x in memo:
            return memo[x]
        memo[x] = max(x, f(x//2) + f(x//3) + f(x//4) + f(x//5))
        return memo[x]
    return f(n)

