import re

def text_match_wordz_middle(text):
    words = re.findall(r'\b\w+\b', text)
    for word in words:
        length = len(word)
        if length < 3:
            continue
        mid = length // 2
        if length % 2 == 1:
            if word[mid] == 'z':
                return True
        else:
            if word[mid-1] == 'z' or word[mid] == 'z':
                return True
    return False

assert text_match_wordz_middle("pythonzabc.")==True

