def is_undulating(n):
    s = str(n)
    if len(s) < 2:
        return False
    a, b = s[0], s[1]
    if a == b:
        return False
    for i, ch in enumerate(s):
        if i % 2 == 0 and ch != a:
            return False
        if i % 2 == 1 and ch != b:
            return False
    return True

