def maxAverageOfPath(matrix):
    n = len(matrix)
    dp = [[(0, 0)] * n for _ in range(n)]
    dp[0][0] = (matrix[0][0], 1)
    for i in range(1, n):
        s, l = dp[i-1][0]
        dp[i][0] = (s + matrix[i][0], l + 1)
    for j in range(1, n):
        s, l = dp[0][j-1]
        dp[0][j] = (s + matrix[0][j], l + 1)
    for i in range(1, n):
        for j in range(1, n):
            s1, l1 = dp[i-1][j]
            s2, l2 = dp[i][j-1]
            avg1 = s1 / l1
            avg2 = s2 / l2
            if avg1 > avg2:
                dp[i][j] = (s1 + matrix[i][j], l1 + 1)
            else:
                dp[i][j] = (s2 + matrix[i][j], l2 + 1)
    s, l = dp[-1][-1]
    return s / l

