def pack_consecutive_duplicates(lst):
    if not lst:
        return []
    result = []
    current = [lst[0]]
    for item in lst[1:]:
        if item == current[-1]:
            current.append(item)
        else:
            result.append(current)
            current = [item]
    result.append(current)
    return result

